--  テーブル hosplistdb.training の構造をダンプしています
DROP TABLE IF EXISTS `training`;
CREATE TABLE IF NOT EXISTS `training` (
  `hos_cd` varchar(10) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '医療機関CD',
  `year` year NOT NULL COMMENT '年度',
  `ins` int NOT NULL COMMENT '0(附)or1(総)',
  `tra_name` varchar(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '研修先医療機関名',
  `dep` varchar(60) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '診療科',
  `position` varchar(30) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '職名',
  `name` varchar(60) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '氏名',
  `start` date NOT NULL COMMENT '診療支援開始日',
  `end` date NOT NULL COMMENT '診療支援終了日',
  `dia_div` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '診療支援区分',
  `date` varchar(300) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '日付',
  PRIMARY KEY (`hos_cd`,`year`,`ins`,`dep`,`name`,`start`,`end`,`date`,`dia_div`,`tra_name`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci ROW_FORMAT=DYNAMIC COMMENT='兼業（編集不可→delete_flgなし）\r\n◎附属病院【最新】\r\n◎総合医療センター【最新】';

